import basicq from "./db/basicq.js"
import "./GamePreview.css"
import mainLayout from "./mainLayout.js";

class GamePreview extends Component {

  render() {
    return (
      <div>
      <div className = "previewdesc">
        <h2 className = 'previewtitle'> pick a set that suits you best! </h2>
      </div>
      <div className = "level">
      <button className = "playbutton">LITE</button>
      </div>
      <div className = "level">
      <button className = "playbutton">DEEP</button>
      </div>

      </div>
    );
  }
}

export default mainLayout(GamePreview);
